import React, { Component } from 'react';
import ReactDom from 'react-dom';
import { Carousel, Item, Caption, Card, Col, Figure } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.css';
import tata_safari from './vehicles/tata_safari.jpeg';
import jeeto from './vehicles/mahindra_jeeto.jpeg';
import scorpio from './vehicles/mahindra_scorpio.jpeg';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css'




//create classNameName for nav
class Courasel_style extends Component {

    render() {

        return (<div> 


<Carousel style={{height:"300px"}}  className="col-12 col-md-12 col-lg-12">
  <Carousel.Item style={{height:"300px"}}>
    <img
      className=""
      src={jeeto}
      alt="First slide"
      style={{ height: '100%',width:'100%' }}
    />
    <Carousel.Caption>

      <p>Jeeto</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item style={{height:"300px"}}>
    <img
      className=""
      src={scorpio}
      alt="Third slide"
      style={{ height: '100%',width:'100%' }}
    />

    <Carousel.Caption>
      <h3>Second slide label</h3>
      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit.</p>
    </Carousel.Caption>
  </Carousel.Item>
  <Carousel.Item style={{height:"300px"}}>
    <img
      className=""
      src={tata_safari}
      alt="Third slide"
      style={{ height: '100%',width:'100%' }}
    />

    <Carousel.Caption>
      <h3>Third slide label</h3>
      <p>Praesent commodo cursus magna, vel scelerisque nisl consectetur.</p>
    </Carousel.Caption>
  </Carousel.Item>
</Carousel>

        </div>
        )
    }
}

export default Courasel_style;
